import React, { useState, useEffect } from 'react'
import { KTSVG, toAbsoluteUrl } from '_metronic/helpers'
import { OrderModel } from '../../models/Order'
import {shallowEqual, useDispatch, useSelector} from 'react-redux'
import { actions } from '../../redux/OrdersRedux'
import { getFunciton } from 'utils/ApiHelper'
import {RootState} from "../../../../../setup";
type Props = {
    item: OrderModel,
    showEdit: boolean,
    index: number,
    //increase: number
}

const OrderItem: React.FC<Props> = ({ item, showEdit, index }) => {
    const [running, setRunning] = useState(0)
    const [success, setSuccess] = useState(0)
    const [loading, setLoading] = useState(true)
    const role: string = useSelector<RootState>(({ auth }) => auth.user?.role, shallowEqual) as string || ""




    const dispatch = useDispatch()
    const clickUpdateHandler = () => {
        dispatch(actions.showcurrentOrder(item))
    }
    const clickDeleteHandler = () => {
        if (window.confirm("bạn có chắc chắn muốn xóa đơn : "+item.videoid!) == true) {
            dispatch(actions.deleteOrderRequest(item.videoid,1))
        }
    }


    //const subNeedRun = item.view_need - (item.current_view - item.start_view)
    //const increase = item.current_view - item.start_view
    return (
        <tr style={{margin:100}}>
            <td className='w-25px'>
                <div className='form-check form-check-sm form-check-custom form-check-solid'>
                    <input
                        onChange={(evt)=>{
                            dispatch(actions.checkedChange({
                                videoid:item.videoid,
                                checked:evt.target.checked
                            }))
                        }}
                        className='form-check-input'
                        type='checkbox'
                        value={1}
                        checked={item.checked}
                        data-kt-check='true'
                        data-kt-check-target='.widget-13-check'
                    />
                </div>
            </td>
            <td>
                <span style={{fontWeight:'bold',fontSize:11,fontFamily:'cursive'}} className='text-muted fw-bold text-muted d-block text-sm'>{index}</span>
            </td>
            <td>

                <a target="_blank" style={{textDecorationLine:'none',fontSize:11,backgroundColor:"#26695c",margin:5,color:"white",}} href={'https://www.youtube.com/watch?v=' + item.videoid} className='badge badge-danger'>
                    {item.videoid}
                </a>
                    <span style={{ color:'black',fontSize:11,backgroundColor:"#c0e1ce"}} className='badge badge-success 1'>{(item.optionbuff==10?'10min':item.optionbuff==30?'30':item.optionbuff==60?'60':item.optionbuff==0?'Auto':'120')+'|'+Math.round(Number(item.duration==null?0:item.duration)/60)+'min'}</span>
                    <span style={{ color:'white',margin:5,fontSize:11,backgroundColor:"#26695c"}} className='badge badge-warning'>{Math.round(Number(item.timebuffh24h==null?0:item.timebuffh24h)/3600)+'/'+(Math.round(Number(item.timebuffhtotal==null?0:item.timebuffhtotal)/3600))+"/"+item.timebuff}</span>
                    <span style={{ color:'black',margin:5,fontSize:11,backgroundColor:"#c0e1ce"}} className='badge badge-dark'>{(item.view24h==null?0:item.view24h)+'/'+(item.viewtotal==null?0:item.viewtotal)+' | '+item.viewstart}</span>
                {Math.round((Math.round(Number(item.timebuffhtotal==null?0:item.timebuffhtotal)/3600)/item.timebuff*100))>=90?
                    <span style={{ color:'white',margin:5,fontSize:11,backgroundColor:"#03d96e"}} className='badge badge-success'>
                        {Math.round((Math.round(Number(item.timebuffhtotal==null?0:item.timebuffhtotal)/3600)/item.timebuff*100))+'%'}</span>:
                    <span style={{ color:'white',margin:5,fontSize:11,backgroundColor:"#26695c"}} className='badge badge-success'>
                        {Math.round((Math.round(Number(item.timebuffhtotal==null?0:item.timebuffhtotal)/3600)/item.timebuff*100))+'%'}</span>
                }
                    <br/>
                {/*
                    <span style={{ color:'white',fontSize:11}} className='badge badge-danger'>{Math.round(Number(item.duration==null?0:item.duration)/60)+'min'}</span>
                    <span style={{ color:'white',margin:5,fontSize:11}} className='badge badge-success'>{(item.mobilerate==null?0:item.mobilerate)+'M'}</span>
                    <span style={{ color:'white',fontSize:11}} className='badge badge-dark'>{(item.homerate==null?0:item.homerate)+'H'}</span>
                    <span style={{ color:'white',margin:5,fontSize:11}} className='badge badge-dark'>{(item.searchrate==null?0:item.searchrate)+'SE'}</span>
                    <span style={{ color:'white',fontSize:11}} className='badge badge-dark'>{(item.suggestrate==null?0:item.suggestrate)+'SU'}</span>
                    <span style={{ color:'white',margin:5,fontSize:11}} className='badge badge-dark'>{(item.directrate==null?0:item.directrate)+'D'}</span>
                    <span style={{ color:'black',fontSize:11}} className='badge badge-warning'>{(item.likerate==null?0:item.likerate)+'L'}</span>
                    <span style={{ color:'black',margin:5,fontSize:11}} className='badge badge-warning'>{(item.commentrate==null?0:item.commentrate)+'C'}</span>
                */}
            </td>
            <td className='text-dark fw-bolder text-hover-primary text-sm'>
                {loading ? <span className='text-muted fw-bold text-muted d-block text-sm'>
                    {"Đang lấy dữ liệu"}
                </span> :
                    <span style={{color:'black',fontSize:11,backgroundColor:"#c0e1ce"}} className='badge badge-dark'>{item.total==1?0:item.total}/{item.maxthreads}</span>
                }
            </td>
            <td>
                {
                    item.enabled === 1 ? <span style={{color:'white',fontSize:11,backgroundColor:"#26695c"}} className='badge badge-success'>R</span> :item.enabled === 2 ?
                        <span style={{color:'white',fontSize:11,backgroundColor:"#26695c"}} className='badge badge-warning'>T1</span>:item.enabled === 3 ?
                        <span style={{color:'white',fontSize:11,backgroundColor:"#26695c"}} className='badge badge-primary'>T2</span>:
                            <span style={{color:'white',fontSize:11,backgroundColor:"#26695c"}} className='badge badge-danger'>S</span>

                }
                {
                    <span style={{color:'black',fontWeight:"bold",fontSize:11,margin:5}} >{new Date(item.insertdate).toLocaleDateString('vn-VN') +" "+ new Date(item.insertdate).toLocaleTimeString('vn-VN')}</span>
                }

            </td>
            <td>
                <span style={{color:'black',fontSize:11,fontWeight:'bold'}} >{item.user}</span>
            </td>
            <td>
               <span style={{color:'black',fontSize:11,fontWeight:'bold'}} >{item.note}</span>
            </td>

            {
                 <td >
                    <a href='#' onClick={clickUpdateHandler} className='btn btn-icon btn-bg-light btn-active-color-primary btn-sm mr-5'>
                        <KTSVG path='/media/icons/duotune/art/art005.svg' className='svg-icon-3' />
                    </a>
                     {role==='ROLE_ADMIN'&&<a href='#' onClick={clickDeleteHandler} className='btn btn-icon btn-bg-light btn-active-color-primary btn-sm'>
                        <KTSVG path='/media/icons/duotune/general/gen027.svg' className='svg-icon-3' />
                    </a>}
                </td>
            }
        </tr>
    )
}

export default OrderItem
